const Text = (props) =>{
    const {textInput,type} = props;
    
    console.log(textInput);
    switch (type){
        case 'h1':
            return <h1>{textInput}</h1>
        case 'h2':
            return <h2>{textInput}</h2>
        default:
            return <p>{textInput}</p>

    }
   
 }
export default Text
